import React, { Component } from "react";
import CompanyApplicationsList from "../CompanyApplication/CompanyApplicationsList";

class Team extends Component {
  state = {};

  render() {
    const { trainee, idMission } = this.props;
    // console.log("team trainee", trainee);
    return (
      <div>
        <h2>My team</h2>
        {trainee &&
          trainee.data.filter(data => (
            <div>
              {data.mission_id === 35 && (
                <p>{data.dataApplications[0].Trainee.firstname}</p>
              )}{" "}
            </div>
          ))}
      </div>
    );
  }
}

export default Team;
